// ==UserScript==
// @name         华医网全自动
// @namespace    http://tampermonkey.net/
// @version      1.2.6
// @description  仅用于华医网，自动播放、自动考试、无人巡航
// @author       otis
// @license      AGPL License
// @match        *://*.91huayi.com/course_ware/course_ware_polyv.aspx?*
// @match        *://*.91huayi.com/course_ware/course_ware_cc.aspx?*
// @match        *://*.91huayi.com/pages/exam.aspx?*
// @match        *://*.91huayi.com/pages/exam_result.aspx?*
// @match        *://*.91huayi.com/*
// @require      https://cdn.jsdelivr.net/npm/jquery@3.7.1/dist/jquery.min.js
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/558495/%E5%8D%8E%E5%8C%BB%E7%BD%91%E5%85%A8%E8%87%AA%E5%8A%A8.user.js
// @updateURL https://update.greasyfork.org/scripts/558495/%E5%8D%8E%E5%8C%BB%E7%BD%91%E5%85%A8%E8%87%AA%E5%8A%A8.meta.js
// ==/UserScript==

(function () {
  'use strict';

  $(document).ready(main);

  function main() {
    const submitTime = 6100;
    const reTryTime = 2100;
    const randomX = 5000;
    const autoSkip = false;
    const keyTest = 'HY_Test';
    const keyResult = 'HY_Result';
    const keyThisTitle = 'HY_ThisTitle';
    const keyTestAnswer = 'HY_TestAnswer';
    const keyRightAnswer = 'HY_RightAnswer';
    const keyAllAnswer = 'HY_AllAnswer';
    const btstyleB =
      'font-size: 12px;font-weight: 300;text-decoration: none;text-align: center;line-height: 20px;height: 20px;padding: 0 5px;display: inline-block;appearance: none;cursor: pointer;border: none;box-sizing: border-box;transition-property: all;transition-duration: .3s;background-color: #4cb0f9;border-color: #4cb0f9;border-radius: 4px;margin: 5px;color: #FFF;';
    const urlInfos = window.location.href.split('/');
    const urlTip = urlInfos[urlInfos.length - 1].split('?')[0];
    const controller = createController();
    let clock = null;
    let timerCheck = null;

    if (urlTip == 'course_ware_polyv.aspx') {
      controller.watchVideo(1);
    } else if (urlTip == 'course_ware_cc.aspx') {
      controller.watchVideo(2);
    } else if (urlTip == 'exam.aspx') {
      controller.handleExam();
    } else if (urlTip == 'course.aspx' || urlTip == 'cme.aspx') {
      controller.showCourseList();
    } else if (urlTip == 'exam_result.aspx') {
      controller.handleExamResult();
    }

    function createController() {
      return {
        showCourseList: function () {
          addAnswerCopyBtn();
          deleteAllAnswers();
        },
        watchVideo: function (e) {
          cleanKeyStorage();

          disablePlayerQuestion();
          disableInteraction();

          autoClosePopups();
          addInfoPanel();
          updateLayout();
          function initVideoWatch() {
            localStorage.setItem(
              keyThisTitle,
              JSON.stringify(window.document.title)
            );
            if (autoSkip == true) {
              setTimeout(function () {
                skipVideo();
              }, submitTime + Math.ceil(Math.random() * randomX));
            }
            let videoEndCheckTimer = null;
            let maxTimeReached = 0;
            let videoCompleted = false;
            let nearEndTriggered = false;

            clock = setInterval(checkExamStatus, 3000);

            function checkVideoEnd() {
              try {
                let currentState = $('i#top_play')
                  .parent()
                  .nextAll()
                  .eq(2)
                  .text();
                if (currentState === '已完成') {
                  return;
                }

                let videoElement = $('video')[0];
                if (!videoElement) {
                  if (videoEndCheckTimer) {
                    clearInterval(videoEndCheckTimer);
                  }
                  return;
                }

                let duration = videoElement.duration;
                let currentTime = videoElement.currentTime;

                if (duration > 0 && currentTime > 0) {
                  if (currentTime > maxTimeReached) {
                    maxTimeReached = currentTime;
                  }

                  let remaining = duration - currentTime;

                  if (remaining < 3 && !nearEndTriggered) {
                    nearEndTriggered = true;
                    videoElement.loop = false;
                  }

                  if (nearEndTriggered && currentTime < maxTimeReached - 5) {
                    videoCompleted = true;
                  }

                  let isEnded =
                    videoElement.ended ||
                    (nearEndTriggered && remaining < 0.3) ||
                    Math.abs(currentTime - duration) < 0.3;

                  if ((isEnded || videoCompleted) && !videoCompleted) {
                    videoCompleted = true;
                  }

                  if (videoCompleted) {
                    if (videoEndCheckTimer) {
                      clearInterval(videoEndCheckTimer);
                    }

                    if (timerCheck) {
                      clearTimeout(timerCheck);
                    }
                    timerCheck = setTimeout(function () {
                      window.location.reload();
                    }, 10000);
                  }
                }
              } catch (e) {}
            }

            videoEndCheckTimer = setInterval(checkVideoEnd, 1000);
            switch (e) {
              case 1:
                window.s2j_onPlayerInitOver();
                {
                  player?.j2s_setVolume(0);
                  $('video').prop('defaultMuted', true);
                  setTimeout(function () {
                    try {
                      player.j2s_resumeVideo();
                      checkExamStatus();
                    } catch (e) {}
                  }, 2000);
                }
                break;
              case 2:
                window.on_CCH5player_ready();
                {
                  cc_js_Player?.setVolume(0);
                  $('video').prop('defaultMuted', true);
                  setTimeout(function () {
                    try {
                      cc_js_Player.play();
                      checkExamStatus();
                    } catch (e) {}
                  }, 2000);
                }
                break;
              default:
                break;
            }
          }
          $(window).on('load', initVideoWatch);
        },
        handleExam: function () {
          let questions = JSON.parse(localStorage.getItem(keyTest)) || {};
          let qRightAnswer =
            JSON.parse(localStorage.getItem(keyRightAnswer)) || {};
          if (JSON.stringify(qRightAnswer) == '{}') {
            qRightAnswer = loadRightAnswers();
          }
          let qTestAnswer = {};
          let index = 0;

          while (true) {
            let question = $('table.tablestyle').eq(index);

            if (question.length === 0) break;
            else {
              let q = question
                .find('.q_name')
                .text()
                .substring(2)
                .replace(/\s*/g, '');

              if (qRightAnswer.hasOwnProperty(q)) {
                let rightSelection = findAnswer(
                  'tbody',
                  index,
                  qRightAnswer[q]
                );
                rightSelection.click();
              } else {
                if (questions.hasOwnProperty(q)) {
                  questions[q] = getNextChoice(questions[q]);
                } else {
                  questions[q] = 'A';
                }

                let answer = getChoiceCode(questions[q]);
                let element = $('tbody').eq(index).find('label').eq(answer);

                if (element.length === 0) {
                  questions[q] = 'A';
                  answer = getChoiceCode('A');
                  element = $('tbody').eq(index).find('label').eq(answer);
                }
                try {
                  let answerText = element.text().substring(3);
                  qTestAnswer[q] = answerText;
                } catch (e) {}
                element[0].click();
              }
              index = index + 1;
            }
          }

          localStorage.setItem(keyTest, JSON.stringify(questions));
          localStorage.setItem(keyTestAnswer, JSON.stringify(qTestAnswer));

          setTimeout(function () {
            $('#btn_submit')[0]?.click();
          }, submitTime + Math.ceil(Math.random() * randomX));
          function findAnswer(qaKey, index, rightAnswerText) {
            let answersList = $(qaKey).eq(index);
            let arr = answersList.find('label');

            for (let i = 0; i < arr.length; i++) {
              if (arr.eq(i).text().substring(3) == rightAnswerText) {
                return arr[i];
              }
            }
          }

          function getChoiceCode(an) {
            let charin = an || 'A';
            return charin.charCodeAt(0) - 'A'.charCodeAt(0);
          }

          function getNextChoice(an) {
            let code = an.charCodeAt(0) + 1;
            return String.fromCharCode(code);
          }
        },
        handleExamResult: function () {
          let res = $('.tips_text').text() || '';
          let dds = $('.state_cour_lis');
          localStorage.removeItem(keyResult);

          if (
            ['考试通过', '完成项目学习', '已学习完'].filter(
              (i) => res.indexOf(i) !== -1
            ).length > 0
          ) {
            saveRightAnswers();
            saveAllAnswers();
            cleanKeyStorage();
            const buttons = $('.state_lis_btn');
            let firstLearn = null;
            buttons.each(function (i) {
              if ($(this).val() === '立即学习') {
                firstLearn = $(this);
                return false;
              }
            });

            buttons.each(function (i) {
              const btn = $(this);
              if (
                btn.val() === '立即学习' ||
                btn.val() === '待考试' ||
                btn.val() === '立即考试'
              ) {
                setTimeout(() => {
                  btn[0]?.click();
                }, 2000);
                setTimeout(() => {
                  if (window.location.href.indexOf('exam_result.aspx') !== -1) {
                    if (firstLearn) {
                      firstLearn[0]?.click();
                    }
                  }
                }, 10000);
                return false;
              }
            });
            let _arr = [];
            buttons.each(function () {
              _arr.push($(this).val());
            });
            if (_arr.every((btn) => btn === '已完成')) {
              setTimeout(() => {
                location.reload();
              }, 60000);
            }
          } else {
            let qWrong = {};
            dds.each(function (i) {
              if (!$(this).find('img').attr('src')?.includes('bar_img')) {
                qWrong[$(this).find('p').attr('title').replace(/\s*/g, '')] = i;
              }
            });

            if (qWrong != {}) {
              localStorage.setItem(keyResult, JSON.stringify(qWrong));
              saveRightAnswers();
              setTimeout(function () {
                $("input[type='button'][value='重新考试']")[0]?.click();
              }, (reTryTime + Math.ceil(Math.random() * randomX)) * 1);
            }
          }
        },
      };
    }
    function saveAllAnswers() {
      let qAllAnswer = JSON.parse(localStorage.getItem(keyAllAnswer)) || {};
      let qRightAnswer = JSON.parse(localStorage.getItem(keyRightAnswer)) || {};
      let qTitle =
        JSON.parse(localStorage.getItem(keyThisTitle)) || '没有记录到章节名称';
      let qOldAnswer = qAllAnswer[qTitle] || {};
      for (let q in qRightAnswer) {
        qOldAnswer[q] = qRightAnswer[q];
      }
      qAllAnswer[qTitle] = qOldAnswer;

      if (qAllAnswer != null) {
        localStorage.setItem(keyAllAnswer, JSON.stringify(qAllAnswer));
      }
    }
    function loadRightAnswers() {
      let qAllAnswer = JSON.parse(localStorage.getItem(keyAllAnswer)) || {};
      let qTitle =
        JSON.parse(localStorage.getItem(keyThisTitle)) || '没有记录到章节名称';
      if (qTitle == '没有记录到章节名称') {
        return {};
      }
      let qOldAnswer = qAllAnswer[qTitle] || {};
      return qOldAnswer;
    }
    function saveRightAnswers() {
      let qRightAnswer = JSON.parse(localStorage.getItem(keyRightAnswer)) || {};
      let qTestAnswer = JSON.parse(localStorage.getItem(keyTestAnswer)) || {};
      let qWrongs = JSON.parse(localStorage.getItem(keyResult)) || {};

      for (let q in qTestAnswer) {
        if (!qWrongs.hasOwnProperty(q)) {
          qRightAnswer[q] = qTestAnswer[q];
        }
      }
      localStorage.removeItem(keyTestAnswer);
      if (qRightAnswer != null) {
        localStorage.setItem(keyRightAnswer, JSON.stringify(qRightAnswer));
      }
    }
    function addAnswerCopyBtn() {
      let alink = $('<a>').html('显示已记录答案').attr('style', btstyleB);

      alink.on('click', function (event) {
        let qAllAnswer = JSON.parse(localStorage.getItem(keyAllAnswer)) || {};
        let Aout = JSON.stringify(qAllAnswer, null, '\t');
        if ($('#AnwserOut').length) {
          $('#AnwserOut').html(Aout);
        } else {
          let textout = $('<textarea>')
            .attr({
              id: 'AnwserOut',
              rows: 20,
              cols: 30,
            })
            .html(Aout);
          $('#main_div').parent().append(textout);
        }
      });
      $('#main_div').parent().append(alink);
    }
    function deleteAllAnswers() {
      let alink = $('<a>').html('清除已记录答案').attr('style', btstyleB);

      alink.on('click', function (event) {
        let r = confirm('确定清除历史答案？!');
        if (r) {
          localStorage.removeItem(keyAllAnswer);
        }
      });
      $('#main_div').parent().append(alink);
    }
    function skipVideo() {
      let oVideo = $('video')[0];
      if (oVideo) {
        oVideo.currentTime = oVideo.duration - 1;
      }
    }

    function startExam() {
      setTimeout(function () {
        $('#jrks')[0]?.click();
      }, Math.ceil(Math.random() * randomX));
    }
    function addInfoPanel() {
      let moderesult = localStorage.getItem('华医mode') || 2;
      if (moderesult == 2) {
        moderesult = '视频+考试（点击切换）';
      } else {
        moderesult = '单刷（点击切换）';
      }
      let checkbox = $('<div>').html(
        '<a id="mode" class="btn btn-default" style="font-size:18px; margin: 10px 0; color:#ff0000" >' +
          moderesult +
          '</a>'
      );
      $('#jj').parent().append(checkbox);
      let mode1 = $('#mode');
      mode1.on('click', function () {
        const mode = localStorage.getItem('华医mode') || '2';
        if (mode == '1') {
          mode1.text('视频+考试（点击切换）');
          localStorage.setItem('华医mode', '2');
        } else {
          mode1.text('单刷（点击切换）');
          localStorage.setItem('华医mode', '1');
        }
      });
      $('.cometn').css('height', 'auto');

      let adiv2 = $('<div>').attr('id', 'jsinfo').css({
        position: 'relative',
        left: '10px',
        top: '5px',
        width: '240px',
        fontSize: '13px',
        textAlign: 'justify',
        border: '1px dashed #ff9595',
        padding: '5px',
        marginBottom: '10px',
      });
      let base64 = 
'';
      adiv2.html(`
                    <div id="jsinfo-content">
                        <p style="margin:5px 0;">如果您觉得当前脚本对您有帮助，或许可以赏我碎银几元哦 0.0</p>
                        <img src="data:image/png;base64,${base64}" style="width:100%;max-width:200px;display:block;margin:10px auto;" alt="赞赏码">
                        <p style="margin:5px 0;text-align:center;">反馈邮箱：call.me@bitx.xx.kg</p>
                    </div>
                    <p id="jsinfo-toggle" style="margin:5px 0;text-align:center;cursor:pointer;">如果你不希望看到上面内容，点我折叠掉</p>
                `);
      $('#jj').parent().append(adiv2);

      const toggleEl = $('#jsinfo-toggle');
      const contentEl = $('#jsinfo-content');
      const storageKey = 'jsinfo_fold_state';
      const threeDays = 3 * 24 * 60 * 60 * 1000;
      const saved = localStorage.getItem(storageKey);
      let isFolded = false;

      if (saved) {
        try {
          const data = JSON.parse(saved);
          if (Date.now() - data.timestamp > threeDays) {
            isFolded = false;
            localStorage.removeItem(storageKey);
          } else {
            isFolded = data.folded;
          }
        } catch (e) {
          isFolded = false;
        }
      }

      const applyState = () => {
        if (isFolded) {
          contentEl.hide();
          toggleEl.text('查看更多');
        } else {
          contentEl.show();
          toggleEl.text('如果你不希望看到上面内容，点我折叠掉');
        }
      };

      applyState();
      toggleEl.on('click', () => {
        isFolded = !isFolded;
        applyState();
        localStorage.setItem(
          storageKey,
          JSON.stringify({
            folded: isFolded,
            timestamp: Date.now(),
          })
        );
      });
    }

    function updateLayout() {
      $('#jj').remove();
      $('.top').replaceWith(
        '<div class="top" style="padding-top: 6px;font-size:18px;color: #ff0000;text-align:center;">页面版本调整可能影响使用，请反馈</div>'
      );
    }

    function cleanKeyStorage() {
      localStorage.removeItem(keyTest);
      localStorage.removeItem(keyResult);
      localStorage.removeItem(keyTestAnswer);
      localStorage.removeItem(keyRightAnswer);
    }

    function playNextVideo() {
      const targetElements = $('i#top_play');
      const parentElement = targetElements.first().parent();
      const grandparentElement = parentElement.parent();

      const lis = $('li.lis-inside-content');
      let index = lis.index(grandparentElement);
      if (index + 2 <= lis.length) {
        index += 2;
        $(
          '#top_body > div.video-container > div.page-container > div.page-content > ul > li:nth-child(' +
            index +
            ') > h2'
        )[0]?.click();
        setTimeout(function () {
          $("button:contains('知道了')").first()[0]?.click();
        }, 2000);
      } else {
        if ($("button:contains('未学习')").length) {
          $("button:contains('未学习')").first().prev()[0]?.click();
        } else if (
          $("button:contains('待考试')").length &&
          $('#mode').text().indexOf('视频+考试') != -1
        ) {
          $("button:contains('待考试')").first().prev()[0]?.click();
        } else if ($("button:contains('学习中')").length) {
          $("button:contains('学习中')").first().prev()[0]?.click();
        } else {
          clearInterval(clock);
        }
      }
    }

    function checkExamStatus() {
      try {
        let examHref = $('#jrks').attr('href');
        let videoState = $('i#top_play').first().parent().nextAll().eq(2).text();

        let isButtonDisabled =
          $('#jrks').is(':disabled') ||
          $('#jrks').attr('disabled') !== undefined;
        let isVideoCompleted =
          examHref != '#' ||
          videoState == '已完成' ||
          videoState == '待考试' ||
          !isButtonDisabled;

        if (isVideoCompleted) {
          if (videoState == '已完成') {
            playNextVideo();
            return;
          }

          let modeResult = localStorage.getItem('华医mode');
          if (modeResult === '2') {
            if (timerCheck) {
              clearTimeout(timerCheck);
              clearInterval(clock);
            }
            if (
              typeof videoEndCheckTimer !== 'undefined' &&
              videoEndCheckTimer
            ) {
              clearInterval(videoEndCheckTimer);
            }
            if (typeof videoCompleted !== 'undefined') {
              videoCompleted = true;
            }

            try {
              startExam();
            } catch (e) {}
          } else {
            playNextVideo();
          }
        }
      } catch (e) {}
    }
    function sleep(timeout) {
      return new Promise((resolve) => {
        setTimeout(resolve, timeout);
      });
    }
    function disablePlayerQuestion() {
      (async function () {
        while (!window.player || !window.player.sendQuestion) {
          await sleep(20);
        }
        player.sendQuestion = function () {};
      })();
    }
    function disableInteraction() {
      if (typeof isInteraction == 'undefined') {
      } else {
        isInteraction = 'off';
      }
    }
    function autoClosePopups() {
      setInterval(async function () {
        try {
          if ($('.pv-ask-head').length) {
            $('.pv-ask-skip')[0]?.click();
          }
        } catch (e) {}
        try {
          if ($('.signBtn').length) {
            $('.signBtn')[0]?.click();
          }
        } catch (e) {}
        try {
          if (
            $("button[onclick='closeProcessbarTip()']").length &&
            $('#div_processbar_tip').css('display') === 'block'
          ) {
            $("button[onclick='closeProcessbarTip()']")[0]?.click();
          }
        } catch (e) {}
        try {
          if ($('button.btn_sign').length) {
            $('button.btn_sign')[0]?.click();
          }
        } catch (e) {}
        try {
          let videoState = $('i#top_play').first().parent().nextAll().eq(2).text();
          if ($('video')[0]?.paused && videoState != '已完成') {
            $('video')[0]?.play();
            $('video').prop('volume', 0);
            $('video').prop('muted', true);
          } else if (videoState == '已完成') {
            $('video')[0].pause();
          }
        } catch (e) {}
      }, 2000);
    }
    initDialogCheck();
    function initDialogCheck() {
      setTimeout(() => {
        const tipDialog = $('#div_processbar_tip');
        if (tipDialog.length && tipDialog.css('display') !== 'none') {
          tipDialog.find('.rig_btn')[0]?.click();
        }
      }, 10000);
    }
  }
})();
